    "we-theme-admin-default/html": "<!DOCTYPE html>\n<html lang=\"{{locale}}\">\n  <head>\n    <title>{{title}} | {{req.we.config.appName}}</title>\n    <meta charset=\"utf-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n    {{#if _csrf}}<meta name=\"csrf-token\" content=\"{{_csrf}}\" />{{/if}}\n    {{{render-metadata-tags}}}\n    {{{render-stylesheet-tags}}}\n    {{{render-javascript-tags 'header'}}}\n  </head>\n  <body>\n    {{we-event event=\"we-html-body-start\"}}\n    <div id=\"wrapper\">\n      {{{template 'partials/header'}}}\n      {{{layoutHtml}}}\n    </div>\n    {{{render-bootstrap-config}}}\n    {{{render-javascript-tags 'footer'}}}\n    {{we-event event=\"we-html-body-end\"}}\n  </body>\n</html>",
    "we-theme-admin-default/layout": "<div id=\"page-wrapper\" style=\"min-height: 160px;\">\n  <div class=\"row\">\n    <div class=\"col-lg-12\">\n      <ol class=\"ember-view breadcrumbs breadcrumb\">\n        <li class=\"first current\">\n          {{#link-to 'admin.index' }}{{t 'home'}}{{/link-to}}\n        </li>\n      </ol>\n\n      {{#unless skipLayoutTitle}}{{#if title}}\n        <h1 class=\"page-header\">{{title}}</h1>\n      {{/if}}{{/unless}}\n\n      <div id=\"sysMessagesArea\">{{{we-messages}}}</div>\n      <div id=\"content\" role=\"main\">{{{body}}}</div>\n    </div>\n  </div>\n</div>",
